import React from "react";

const Accordian3 = () => {
  return (
    <div className="w-[1264px] h-[90px] flex justify-between rounded-2xl mt-8 items-center border border-gray-100">
      <div className="flex gap-4 ml-4">
        <img src="images/Group 87.png" alt="group" />
        <span className="flex flex-col bg-[#F6F7F9]">
          <h1>1. How can I find trials suitable for my condition?</h1>
          <p className="text-sm font-light">
            Use our search feature, input your condition, and explore relevant
            trials matching your criteria.
          </p>
        </span>
      </div>
      <div className="mr-4">
        <img src="images/Vector8.png" alt="vector" />
      </div>
    </div>
  );
};

export default Accordian3;
